function App() {


  return (

    <Navbar className="bg-body-tertiary">
    <Container>
      <Navbar.Brand href="{{ url('/home') }}">My Demo App</Navbar.Brand>
      <Navbar.Toggle />
      <Navbar.Collapse className="justify-content-end">
        <Navbar.Text>
          <Nav.Link href="#action1">Home</Nav.Link>
          <Nav.Link href="#action2">Link</Nav.Link>
        </Navbar.Text>
      </Navbar.Collapse>
    </Container>
  </Navbar>

  );
}

export default App;
